import React from "react";
import { StyleSheet } from "react-native";
import Color from "../../../../../assets/Color";
const styles = StyleSheet.create({
  Box: {
    width: 300,
    height: 175,
    backgroundColor: Color.cardGrayColor,
    marginRight: 15,
    borderRadius: 8,
    marginBottom: 12,
  },
});

export default styles;
